import React from 'react'
import logo from './logo.svg';
import './App.css';
import Home from './Home';
import Pred from './PricePredictions';
import GenPred from './GeneratedPredictions';
import { Route, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Route to="/" component={Home} />
      <Route to="/PricePredictions" component={Pred} />
      <Route to="/GeneratedPredictions" component={GenPred} />



    </div>
  );
}

export default App;
